import React from "react";
import { Outlet } from "react-router-dom";
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import NewTopic from './components/NewTopic/NewTopic';

function Root () {
    return (
        <>
            <Header />
            <Outlet />
            <Footer />
            <NewTopic />
        </>
    )
}

export default Root;
